/** Настройки системы заказа продукции в бизнес */
export const enum ORDER_CONFIG {
    /** Минимальная сумма которую получит игрок за случайный заказ */
    NPC_DELIVER_COST_MIN = 2400,
    /** Максимальная сумма которую получит игрок за случайный заказ */
    NPC_DELIVER_COST_MAX = 2900,
    /** Максимальный уровень */
    MAX_LEVEL = 2,
    /** Сколько заказов необходимо выполнить чтобы получить новый уровень */
    LEVEL_STEP = 300,
    /** Сколько процентов дохода добавляется за каждый уровень. Изначальный уровень - 0, т.е. надбавки не будет */
    PERCENT_COST_ADD_PER_LEVEL = 20,
    /** Комиссия в процентах для доставки */
    COMISSION = 5,
    /** Какая сумма будет выдана игроку при возврате арендованого транспорта */
    VEHICLE_RENT_RETURN = 300,
    /** Количество минут, которые даються на погрузку  */
    LOAD_TIME = 10,
    /** Количество минут, которые даються на доставку */
    DELIVER_TIME = 30,
    /** Через сколько минут заказ будет автоматически доставлен, если его никто не взял */
    AFK_TIME = 90,
    /** Процент от залога, который идёт от суммы комиссии, чтобы люди просто так не брали заказы */
    ZALOG = 30,
}

/** Координаты точки аренды транспорта для перевозки заказов. Плоский маркер */
